function pFTrace(rxInfo, lat, lon) {
    let g = []; // Gateways
    let s = []; // snrýs

    let nLat = lat; // Latitude do Node
    let nLon = lon; // Longitude do Node

    for (const it of rxInfo) {
        s.push(it.snr); // Indice para pegar melhor sinal
        g.push({ // Informaýýes dos gateway na visada
            gwID: it.gatewayId,
            gwLat: it.location.latitude,
            gwLon: it.location.longitude,
            rssi: it.rssi,
            snr: it.snr,
        });
    }

    if (s.length > 1) { // Se mais de um gateway recebeu o pacote...
        const i = s.reduce((accumulator, current, index) => { // Rertorna o indice de qual foi
            return current > s[accumulator] ? index : accumulator;
        }, 0);
        g.unshift(g.splice(i, 1)[0]); // Remove e Re-Posiciona na primeira posicao do objeto
    }

    let snrTrace = ([[nLat, nLon], [g[0].gwLat, g[0].gwLon]])

    return snrTrace;
}

